export const CatFacts = () => {
  const [facts, setFacts] = useState([]);

  useEffect(() => {
    fetch('https://cat-fact.herokuapp.com/facts')
    .then(res => res.json())
    .then(data => console.log(data))
    .catch(err => console.error(err));

  },[facts])


  return (
    <div>
      <button></button>
    </div>
  )
}
